import React from "react";
import styled from "styled-components";

const SloganDomain = styled.div`
  width: 300px;
  height: 300px;
  background: green;
  position: absolute;
  top: 200px;
  left: 200px;
`;

function Slogan_Domain() {
  return (
    <>
      <SloganDomain />
    </>
  );
}

export default Slogan_Domain;
